import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import CreateArea from "./CreateArea";

function App() {

  let notes = [{
    title: "test title",
    content: "test content"
  },]

  function addNote(note){
    notes.push(note)
    console.log(notes)
  }

  return (
    <div>
      <Header />
      <CreateArea 
      onAdd={addNote}/>
      <Note 
      key={1} 
      title={notes.title[0]}
      content={notes.content[0]}
      />
      <Footer />
    </div>
  );
}

export default App;
